import Nav from '../components/Nav'
import { useState } from 'react'


const Home = () => {

    const authToken = true;
    const [showModal, setShowModal] = useState(false)


    const handleClick = () => {
        console.log('clicked')
        setShowModal(true)



    }




    return (
        <div>

            <Nav
                showModal={showModal}
            />
            <div className="home">
                <h1>Swipe Right</h1>
                <button className="primary-button" onClick={handleClick}>
                    {authToken ? 'Signout' : 'Create Account'}
                </button>

                {showModal && (
                    <div>
                        this will show SignIn was clicked
                    </div>
                )}

            </div>
        </div>
    )
}

export default Home;
